  firc           VARCHAR2(6),           --金融机构所在地区编码
  fict           VARCHAR2(2),           --金融机构代码类型
  ficd           VARCHAR2(12),           --金融机构代码
  stcr           VARCHAR2(500),           --可疑特征（多选）用","分隔
  ssdg           VARCHAR2(2),            --可疑程度
  tkms           VARCHAR2(128),          --采取措施
  ssds           VARCHAR2(500),          --可疑行为描述
