  STCB	VARCHAR2(4000)	,        --	资金交易及客户行为情况
  AOSP	VARCHAR2(4000)	,         --	疑点分析
  TOSC	VARCHAR2(500)	,	          --疑似涉罪类型（多选） 用","分隔
  xmlnm          VARCHAR2(128),          --xml文件名
  zipnm          VARCHAR2(128),          --zip包名
  rec_status     VARCHAR2(2),            --记录状态
  rep_status     VARCHAR2(2),            --回执状态
  approve_status VARCHAR2(2),            --审核状态
  is_sub_success VARCHAR2(1),            --是否成功上报
  approve_result      VARCHAR2(256),    --审核说明
  approve_upd_tlr     VARCHAR2(20),    --最后审核用户
  approve_upd_tm      DATE,            --最后审核时间
  lst_upd_tlr         VARCHAR2(20),    --最后操作用户
  lst_upd_tm          DATE,            --最后操作时间
