  ERRMSG       VARCHAR2(500),
  filler1        VARCHAR2(64),
  filler2        VARCHAR2(64),
  filler3        VARCHAR2(64),
  filler4        VARCHAR2(64),
  filler5        VARCHAR2(64),
  filler6        VARCHAR2(64),
  PRIMARY KEY (REC_ID)
);

