create table AML_BHBS_DS_BAK as select * from AML_BHBS_DS_HIS where 1=2;

--大额上报记录状态表(按报告机构和工作日期区分)
CREATE or REPLACE view vi_aml_bhbs_ds_status as 
select a.ricd,a.work_date as work_date,
       count(*) as allNum ,                                                             --记录总数
       sum(case when a.rec_status in ('01','04','99') then 1 else 0 end) as noCollNum,  --待补录(01-待补录，04-校验不通过，99-已暂存)
       sum(case when a.rec_status in ('02') then 1 else 0 end) as noReportNum,         --待上报（02-已补录待上报）
       sum(case when a.rec_status in ('03') then 1 else 0 end) as noCheckNum,         --待校验（03-已上报待校验）
       sum(case when a.rec_status in ('05') then 1 else 0 end) as noPackageNum,        --待打包（05-已通过校验）
       sum(case when a.rec_status in ('06') then 1 else 0 end) as isPackageNum,        --已打包（06-已打包）
       sum(case when a.rec_status in ('00','07','08') then 1 else 0 end) as otherNum    --其他状态（00-确认不上报待审核，07-已删除，08-确认不上报）
  from aml_bhbs_ds a
  group by a.ricd,a.work_date;

